import React from "react";

import { NavermapsProvider } from "react-naver-maps";
import {
  Container as MapDiv,
  NaverMap,
  Marker,
  useNavermaps,
} from "react-naver-maps";

function MiniMap() {
  return (
    <MapDiv
      style={{
        width: "auto",
        height: "23rem",
      }}
    >
      <NaverMap
        defaultCenter={{ lat: "37.3595704", lng: "127.105399" }}
        defaultZoom={10}
      />
    </MapDiv>
  );
}

export default MiniMap;
